    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "N\u00e5r en ny tjenestetunnel opprettes, eller en tjeneste kj\u00f8res for f\u00f8rste gang (f.eks. standard Jetty-webserver, utvidelser), opprettes det en privat krypteringsn\u00f8kkel som i praksis kontrollerer eierskapet til adressen. Denne er vanligvis kalt <code>&hellip;privKey.dat</code>, eller <code>eepPriv.dat</code>, men det er en god id\u00e9 \u00e5 endre navnet for \u00e5 indikere hvilken tjeneste den tilh\u00f8rer, og deretter angi dette i innstillingene for Tunnel Manager-serveren. Denne .dat-filen b\u00f8r sikkerhetskopieres p\u00e5 en trygg m\u00e5te; hvis du mister den, mister du eierskapet og kontrollen over vertsnavnet ditt!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Denne innstillingen lar deg konfigurere det maksimale antallet filer per torrent som I2PSnark tillater, ved nedlasting eller oppretting av en torrent. Merk at betydelig \u00f8kning av denne verdien fra standarden p\u00e5 2000 filer kan kreve ekstra konfigurasjon p\u00e5 vertssystemet for \u00e5 \u00f8ke det maksimale antallet \u00e5pne filer som operativsystemet vil tillate (f.eks. <code>ulimit -n</code> p\u00e5 Linux). For \u00e5 endre, legg til i I2PSnark sin konfigurasjonsfil <code>i2psnark.config</code>. [Omstart av I2PSnark eller ruter er n\u00f8dvendig]";
    t[370] = "Configure router bandwidth allocation";
