    t[617] = "Bonuser kan v\u00e6re positive eller negative, og p\u00e5virke peerens inkludering i rask og h\u00f8y kapasitetsniv\u00e5. Rask jevnaldrende brukes til klienttunneler, og jevnaldrende jevnaldrende brukes til noen utforskende tunneler.";
    t[618] = "Yes";
    t[619] = "Ja";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "Selv om I2P vil fungere fint i denne konfigurasjonen, vil det v\u00e6re mye mer hjelpsomt for nettverket hvis du \u00e5pner brannmuren hvis du virkelig har mer enn 128KBps b\u00e5ndbredde \u00e5 dele.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "En kommandolinjeapplikasjon levert med I2P som brukes til \u00e5 be om URL-ressurser, lignende <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> eller <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget brukes ogs\u00e5 internt av ruteren, for eksempel for \u00e5 res\u00e5 fra eksterne verter. Som standard bruker eepget HTTP-proxyen p\u00e5 <code>127.0.0.1:4444</code>.";
