    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Nettserveren din kj\u00f8rer som standard p\u00e5 <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, men er ikke tilgjengelig for andre f\u00f8r du starter <i>I2P Webserver</i>-tunnelen. Etter \u00e5 ha startet tunnelen, vil nettstedet ditt v\u00e6re vanskelig for andre \u00e5 finne. Du kan bare fortelle folk destinasjonen eller Base32-adressen, men heldigvis har I2P en adressebok for \u00e5 lagre domenenavn, og forskjellige tjenester der du kan <a href=/help/hostnameregistration>registrere et nytt .i2p-domene</a> gratis.";
