    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Forskjellen (avviket) p\u00e5 datamaskinens klokke i forhold til nettverkssynkronisert tid (hvis kjent). I2P krever at datamaskinens klokke er n\u00f8yaktig. Hvis avviket er mer enn noen f\u00e5 sekunder, vennligst juster datamaskinens klokke for \u00e5 korrigere avviket. Hvis I2P ikke kan koble til internett, kan det indikeres en avlesning av 0ms. Merk: Dette vises kun i delen <i>Router Information (advanced)</i>. Du kan legge til denne delen i sidepanelet p\u00e5 siden <a href='/configsidebar'>Sidebar Configuration</a>.";
