    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "F\u00f8r du forteller verden om din nye nettside, b\u00f8r du legge til noe innhold. G\u00e5 til serverens rotdirectory <a href=#rootdir>som er oppf\u00f8rt over</a> og erstatt videresendingssiden <i>index.html</i> med ditt eget innhold. Hvis du trenger en mal for en grunnleggende side, gjerne tilpasse <a href=http://127.0.0.1:7658/help/pagetemplate.html>denne siden</a>. Hvis du blir sendt tilbake til denne siden etter \u00e5 ha redigert innholdet, pr\u00f8v \u00e5 t\u00f8mme nettleserens nettbuffer.";
