    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "For \u00e5 skaffe ditt eget vertnavn, tilbyr I2P domeneregistrarer som <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> eller <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> registreringstjenester som lar deg registere og administrere et .i2p vertnavn eller underdomene som deretter blir propagerert over nettverket. Noen registreringssider vil kreve <i>B64 destinasjonsadresse</i> for tunnel/tjenesten du \u00f8nsker \u00e5 knytte til et vertnavn, noe du kan kopiere fra <i>Lokal destinasjon</i> -delen p\u00e5 siden for Konfigurering av Tunnelbehandleren <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnelbehandler Konfigurerings-siden</a>.";
