    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Dette indikerer mengden RAM I2P bruker, og den totale mengden tilgjengelig, tildelt av Java. Hvis bruken er konsekvent h\u00f8y i forhold til den tilgjengelige RAM-en, kan dette indikere at du m\u00e5 \u00f8ke mengden RAM som er tildelt til JVM. Du kan tildele mer RAM ved \u00e5 redigere filen <code>wrapper.config</code>, som vanligvis befinner seg i I2P-applikasjonskatalogen. Du m\u00e5 redigere parameteren <code>wrapper.java.maxmemory</code>, som som standard er satt til 256 (MB) for I2P, eller 384 for I2P+. Merk: Hvis minnefeltet er aktivert, vil oppf\u00f8ringen for minnet i routerinfo-delen bli undertrykt.";
