    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Denne innstillingen (i sekunder) lar deg overstyre forsinkelsen mellom kj\u00f8ringene av Peer Exploration Job som fors\u00f8ker \u00e5 finne nye noder som skal legges til i NetDb. Jobben kj\u00f8rer hvert 80. sekund som standard, eller hvis ruteren opplever jobb- eller meldingsforsinkelse, hvert 3. minutt. Hvis st\u00f8rrelsen p\u00e5 NetDb n\u00e5r 4000 noder, vil pausen \u00f8ke til 15 minutter. Du kan \u00f8nske \u00e5 \u00f8ke forsinkelsen hvis NetDb-en din er godt befolket (over 2000 noder), eller hvis du vil redusere b\u00e5ndbreddebruken generelt. Merk: For Floodfill-rutere kj\u00f8rer ikke denne jobben.";
    t[2698] = "Current";
    t[2699] = "N\u00e5v\u00e6rende";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Et nettsted som er vert for I2P-nettverket. Som standard er en <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty-webserver</a> konfigurert og kj\u00f8rer p\u00e5 <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Kan deaktiveres eller endres i <a href=/i2ptunnelmgr>Tunnel Manager</a>. Kan ogs\u00e5 konfigureres for \u00e5 binde til en spesifikk interface eller alle interfacer.";
