    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Du kan opprette en ny ruterfamilie her. N\u00e5r du har opprettet familien, kan du eksportere familiens n\u00f8kkelfil og dele med andre rutere i din nominerte familie.";
