    t[2759] = "Avansert oppslag";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "For \u00e5 f\u00e5 tilgang til nettsteder som er vert p\u00e5 I2P, og eventuelt bruke standard utproxy for \u00e5 koble til nettsteder p\u00e5 clearnet, m\u00e5 du konfigurere nettleseren din for \u00e5 bruke I2P HTTP-proxyen, som vanligvis kj\u00f8rer p\u00e5 <code>127.0.0.1 port 4444</code>. De fleste nettlesere tilbyr en mulighet for \u00e5 konfigurere proxyen din; i denne mini-oppl\u00e6ringen vil vi fokusere p\u00e5 Firefox.";
    t[2776] = "Close to us";
