    t[2796] = "Streaming radio service";
    t[2797] = "Streaming radiotjeneste";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ fungerer best n\u00e5r du n\u00f8yaktig kan gjenspeile hastigheten p\u00e5 nettverkstilkoblingen din i <a href=/config>b\u00e5ndbreddekonfigurasjonen</a>. I2P+ er som standard konfigurert med noen ganske konservative verdier som ikke passer til mange bruksomr\u00e5der, s\u00e5 vennligst ta deg tid til \u00e5 gjennomg\u00e5 disse innstillingene og rett opp hvor det er n\u00f8dvendig. Jo mer b\u00e5ndbredde du tildeler, <i>spesifikt</i> opplastingsb\u00e5ndbredde, jo mer vil du dra nytte av nettverket.";
