    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Dette er det totale antallet jevnbyrdige maskiner som ruteren din kjenner. De er oppf\u00f8rt p\u00e5 siden <a href='/netdb'>Nettverksdatabase</a>. Dette kan variere fra under 100 til 1000 eller mer. Dette tallet er ikke st\u00f8rrelsen p\u00e5 nettverket i sin helhet; det kan variere mye avhengig av totalkapasiteten, delt b\u00e5ndbredde og lokalt generert trafikk. I2P krever ikke at ruteren kjenner alle de andre rutere i nettverket.";
