    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "N\u00e5r satt til true, vil ekstra funksjonalitet bli aktivert i konsollen og brukeren vil kunne redigere innstillinger direkte p\u00e5 <a href=/configadvanced>Avansert konfigurasjonsside</a>. Ekstra visningsalternativer er tilgjengelige i <a href=/netdb>Nettverksdatabaseavsnittet</a>, inkludert <a href='/netdb?f=3'>Sybil-analyseverkt\u00f8y</a>, og det er flere konfigureringsalternativer p\u00e5 <a href=/configclients>Konfigureringssiden for klienter</a>. Dette muliggj\u00f8r ogs\u00e5 installasjon av usignerte oppdateringer, manuell konfigurering av nyhets-URL og flere seksjoner i sidepanelet.";
