    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Dette er antallet jevnbyrdige maskiner som ruteren din har tilgjengelig for \u00e5 bygge klienttunneler. Det er vanligvis i omr\u00e5det 8-30. De raskeste maskinene dine vises p\u00e5 siden <a href='/profiles'>Profiler</a>. <a href='/configstats#router.fastPeers'>[Aktiver grafing]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Klikk <i>Reseed from File</i>-knappen";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "En variant av l\u00f8kruting som krypterer flere meldinger sammen for \u00e5 gj\u00f8re det vanskeligere for angripere \u00e5 utf\u00f8re trafikkopplysningsanalyse og \u00f8ke hastigheten for dataoverf\u00f8ring. For mer informasjon, se <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online-dokumentasjonen</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Hvordan herde WordPress-nettstedet ditt";
    t[3496] = "I2P Internals";
    t[3497] = "Interne I2P-bestanddeler";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Som standard er I2P levert med en webserver som kan huse ditt eget anonymiserte nettsted (tradisjonelt referert til som en <i>eepsite</i>). B\u00e5de nettstedet og I2P-ruterens konsoll kj\u00f8rer p\u00e5 en tilpasset versjon av <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, tilpasset for I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Denne innstillingen lar deg ekskludere eldre rutere fra NetDb-en din. Rutere eldre enn standardverdien eller verdien du setter, vil bli slettet fra NetDb-en og utestengt for varigheten av ruteren. Som standard ekskluderes rutere eldre enn 0.9.20. Merk: Fra og med I2P+ versjon 0.9.46+ brukes bare rutere som kj\u00f8rer veldig nye versjoner for \u00e5 bygge lokale tunneler. [Krever omstart]";
