    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "De ruterkonfigurasjonsalternativene som er oppf\u00f8rt nedenfor, er ikke tilgjengelige i brukergrensesnittet, vanligvis fordi de sjelden brukes eller gir tilgang til avanserte innstillinger som de fleste brukere ikke trenger. Dette er ikke en fullstendig liste. Noen innstillinger krever at ruteren startes p\u00e5 nytt for \u00e5 tre i kraft. Merk at alle innstillinger skriftf\u00f8res. Du m\u00e5 redigere din <code>router.config</code> -fil for \u00e5 legge til alternativer eller n\u00e5r du har lagt til <code>routerconsole.advanced=true</code> i router.config-filen, kan du redigere innstillinger i konsollen p\u00e5 siden for <a href=/configadvanced>avansert konfigurasjon</a>.";
