    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Noen IRC-klienter er konfigurert til \u00e5 koble fra serveren hvis det ikke har v\u00e6rt noen kommunikasjon med serveren i en gitt tidsperiode, noe som kan v\u00e6re problematisk for I2P IRC hvis <i>ping timeout</i> verdien er satt for lavt. \u00c5 sette ping timeout-verdien i klienten din til en h\u00f8y verdi (f.eks. 320 sekunder) vil ofte resultere i en mer stabil tilkobling til nettverket. I hexchat kan du konfigurere verdien ved \u00e5 skrive <code>/set net_ping_timeout 320</code>. Dette vil skrive verdien til din <code>hexchat.conf</code>-fil.";
    t[3964] = "Run at Startup?";
    t[3965] = "Kj\u00f8r ved oppstart?";
