    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ st\u00f8tter tilpassede tema-overstyrrelser for konsollen, tunnelbehandlingen, I2PSnark, SusiDNS og Susimail, som tillater endringer av temaene som er varige etter oppdateringer. For \u00e5 aktivere en overstyrrelse, oppretter du en css-fil som heter <code>override.css</code> med dine temaendringer og legger den i den relevante temaets katalog for temaet du \u00f8nsker \u00e5 endre, eller omd\u00f8per en av eksempelfilene, og oppdater deretter nettleseren (hard refresh). Merk at tunnelbehandlingen og konsollen deler samme override.css. For \u00e5 deaktivere en overstyrrelse, sletter du eller omd\u00f8per filen <code>override.css</code> og oppdater deretter nettleseren (hard refresh) (vanligvis Kontroll + Skift + R).";
