    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Hvis etter noen minutter med oppetid, viser ruteren 0 aktive noder og 0 kjente noder, med en melding i sidefeltet om at du m\u00e5 sjekke nettverkstilkoblingen, bekreft at du kan f\u00e5 tilgang til internett. Hvis internettforbindelsen din fungerer, kan du pr\u00f8ve \u00e5 oppheve blokkeringen av Java i brannmuren din. Ellers kan det bli n\u00f8dvendig \u00e5 gjens\u00e5 i2pruteren. Bes\u00f8k <a href=/configreseed#reseedconfig>Reseed Configuration page</a> og klikk p\u00e5 knappen <i>Lagre endringer og gjens\u00e5 n\u00e5</i> For mer informasjon, se <a href=#reseedhelp>Gjens\u00e5 hjelpeseksjonen</a> ovenfor.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Et h\u00f8yere niv\u00e5s socket-API for kunder. \u00c5pnes bare n\u00e5r en SAM V3-klient ber om en UDP-sesjon. Kan aktiveres/deaktiveres p\u00e5 <a href=/configclients>Fil- og innstillinger for samhandling med klienter</a>. Kan endres i <code>clients.config</code>-filen med SAM-kommandolinjealternativet <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Hvis du vil at nettstedet ditt skal f\u00f8les responsivt, er bildekomprimering essensielt n\u00e5r du hoster store bilder. Bruk en tjeneste som <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> for \u00e5 komprimere png- og jpeg-bilder. Dette vil ofte resultere i mye mindre filer med minimal tap av kvalitet. I noen situasjoner kan webp-formatet v\u00e6re bedre enn jpegs, da det genererer mindre filer med omtrent samme eller bedre visuell troverdighet, og har bred st\u00f8tte i nettlesere. Vurder ogs\u00e5 \u00e5 bruke svgs i stedet for bitmap-bilder for ikoner og illustrasjoner - de er ofte mindre enn tilsvarende bitmap-filer (kj\u00f8r dem gjennom en tjeneste som <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> for \u00e5 fjerne un\u00f8dvendig data), og de kan skaleres uten tap av kvalitet, samt gzippe av webserveren din.";
    t[5528] = "UPnP disabled on the device";
