    t[5545] = "Denne delen er ikke aktivert som standard med mindre <a href='/help/configuration#advancedconsole'>Avansert konsollmodus</a> er aktivert. Du kan aktivere den p\u00e5 <a href='/configsidebar'>Konfigurasjonsside for sidepanelet</a>.";
