    t[5684] = "Check to see if another program is using the configured port. If so, stop that program or configure I2P to use a different port.";
    t[5685] = "Sjekk om en annen program bruker den konfigurerte porten. Hvis det er tilfelle, stopp det programmet eller konfigurer I2P til \u00e5 bruke en annen port.";
