    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Denne innstillingen (i millisekunder) lar deg manuelt konfigurere forsinkelsen mellom oppdateringer av ruteren, som utf\u00f8res av jobben 'Refresh Routers'. Som standard bestemmes pausen mellom oppdateringene av st\u00f8rrelsen p\u00e5 NetDb, og introduserer noe tilfeldighet i timingen for \u00e5 begrense trafikk-analyse. For verdier lavere enn 2000 millisekunder, anbefales det \u00e5 \u00f8ke verdien for <code>router.refreshTimeout</code>. V\u00e6r oppmerksom p\u00e5 at hvis denne verdien settes lavere enn 2000 millisekunder vil nettverkstrafikken \u00f8ke og det kan oppst\u00e5 oppgaveforsinkelse. Dette anbefales ikke for vedvarende bruk.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Servertunneler, konfigurerbare i <a href=/i2ptunnelmgr>Tunnel Manager</a>, gir en rekke m\u00e5ter \u00e5 begrense tilgangen til den vertsbaserte tjenesten. Destinasjonsomfattende liste, svartelisting, begrensning av tilkoblinger og tunnelfiltrering er metoder som er tilrettelagt for \u00e5 motvirke tjenestenektingsangrep, gi eksklusiv tilgang til kjente I2P-destinasjoner og administrere trafikk til serveren.";
