    t[6244] = "The act of contributing to the network by permitting other routers to build tunnels using your router in a tunnel chain. At least 12KB/s upstream bandwidth (network share) is required to be allocated in order to enable participation. Note that firewalled routers will be limited in how much they contribute to participation, and a router designated as Hidden will not participate at all.";
    t[6245] = "Handlingen med \u00e5 bidra til nettverket ved \u00e5 tillate at andre rutere bygger tunneler ved \u00e5 bruke ruteren din i en tunnelkjede. Det kreves minst 12 KB/s oppstr\u00f8ms b\u00e5ndbredde (nettverksandel) som m\u00e5 allokeres for \u00e5 aktivere deltakelse. Merk at rutere med brannmur vil v\u00e6re begrenset i hvor mye de bidrar til deltakelsen, og en ruteren som er merket som skjult vil ikke delta i det hele tatt.";
