    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ kan v\u00e6re treg med \u00e5 integrere i nettverket f\u00f8rste gang du kj\u00f8rer det n\u00e5r det starter nettverket og l\u00e6rer om ytterligere deltakere. Jo lenger I2P+-ruteren din kj\u00f8rer, jo bedre vil den yte, s\u00e5 pr\u00f8v \u00e5 holde ruteren aktiv s\u00e5 lenge du kan, 24 timer i d\u00f8gnet dersom mulig! Hvis, etter 30 minutter, antall holdere for <i>Active: [connected/recent]</i> fremdeles er mindre enn 10, eller totalt antall holdere for <i>Integrated</i> er mindre enn 5, er det flere ting du kan gj\u00f8re for \u00e5 sjekke etter problemer:";
