    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "En Java-implementasjon av en Tor-klient, tilgjengelig som en I2P-tillegg. Kan brukes som standard <i>outproxy</i> hvis det er konfigurert for relevant SOCKS- eller HTTP-klienttunnel i <i>Tunnel Manager</i>. Tilgjengelig p\u00e5 <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Kildekoden er tilgjengelig p\u00e5 <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "IPv4-adresser";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Denne delen viser din gjennomsnittlige b\u00e5ndbreddehastighet og totalbruk for \u00f8kten. Alle verdier er i bytes per sekund. Du kan endre b\u00e5ndbreddegrensene dine p\u00e5 siden for <a href='/config'>B\u00e5ndbreddekonfigurasjon</a>. Jo mer b\u00e5ndbredde du gj\u00f8r tilgjengelig, jo mer hjelper du nettverket og forbedrer din egen anonymitet, s\u00e5 vennligst ta deg tid til \u00e5 gjennomg\u00e5 innstillingene. Hvis du er usikker p\u00e5 hastigheten til nettverket ditt, vil tjenester som <a href='http://speedtest.net/'>SpeedTest</a> eller lignende gi deg en god indikasjon p\u00e5 b\u00e5ndbreddeenheten din. Mengden av din oppstr\u00f8msandel (KBps Out) vil avgj\u00f8re ditt totale bidrag til nettverket. B\u00e5ndbredde er <a href='/graphs'>grafisk representert</a> som standard.";
