    t[7171] = "Denne innstillingen bestemmer hvilken transport som prioriteres ved kommunikasjon med jevnaldrende. Som standard foretrekkes NTCP fremfor UDP (SSU). Ved \u00e5 sette verdien til true, vil UDP foretrekkes med mindre det allerede eksisterer en NTCP-tilkobling; n\u00e5r den er satt til alltid, vil UDP alltid bli brukt uansett om det allerede eksisterer en NTCP-tilkobling. [Standard er false]";
