    t[7285] = "Dataene som samles inn er kvantisert over en periode p\u00e5 1 minutt, s\u00e5 de b\u00f8r bare brukes som et estimat.";
    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "N\u00e5r satt til true, kj\u00f8rer I2P uten nettverkstilkobling, noe som er nyttig hvis du stadig starter ruteren p\u00e5 nytt for \u00e5 teste kodeoppdateringer, da dette forhindrer nettverksforstyrrelser.";
    t[7302] = "Updating IP address";
    t[7303] = "Oppdaterer IP-adressen";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "IPv6 Kun SSU, introdusere";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) er en I2P-nettverkstransport som gir krypterte, tilkoblingsorienterte punkt-til-punkt-tilkoblinger, i tillegg til IP-adresseoppdagelse og NAT-traverseringstjenester. For mer informasjon, se <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>den nettbaserte dokumentasjonen</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Overbelastningsvindu";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Bruk proxy for \u00e5 gjenopprette";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "F\u00f8r I2P-integrasjonen i <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a> var det ikke mulig \u00e5 laste ned torrents som ikke var vertskap p\u00e5 I2P-nettverket. Imidlertid, n\u00e5 som Vuze (og senere <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) tillater brukere \u00e5 dele ikke-I2P torrents p\u00e5 I2P, kan ikke-I2P torrents lastes ned over I2P hvis Vuze/Bigly-brukere har valgt \u00e5 gj\u00f8re innhold tilgjengelig for I2P-nettverket. Popul\u00e6re torrents med et stort antall jevnbyrdige er mer sannsynlig \u00e5 v\u00e6re tilgjengelige via I2P; for \u00e5 finne ut om innholdet er tilgjengelig, legg til torrentlinken, magneten eller infohashen i din I2P-kompatible BitTorrent-klient.";
