    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Hvis en <i>Registreringsautentisering</i>-streng er n\u00f8dvendig, finner du den p\u00e5 <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registreringsautentiseringssiden</a> som er linket fra <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager-konfigureringssiden</a>. Registreringsautentisering sikrer at kun eieren kan registrere eller administrere vertsnavnet, og er p\u00e5krevd p\u00e5 stats.i2p og reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Nyheter og oppdateringer";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Hvis du ikke kan starte ruter med <code>i2p/i2prouter start</code>, pr\u00f8v skriptet <code>runplain.sh</code> i samme mappe. Rotrettigheter er aldri n\u00f8dvendig for \u00e5 kj\u00f8re I2P+. Hvis du trenger \u00e5 kompilere <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi-biblioteket</a> (som er n\u00f8dvendig i sjeldne tilfeller), konsulter dokumentasjonen, bes\u00f8k forumene eller bes\u00f8k <a href=irc://127.0.0.1:6668/saltR class=chatlink>I2P+ kanalen</a> eller <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC utviklerkanal</a>.";
