    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "En distribuert database som inneholder kontaktinformasjon om rutere (RouterInfos) og kontaktinformasjon om destinasjoner (LeaseSets). En enkelt ruter vedlikeholder sin egen (delvise) database for kommunikasjon med andre rutere i nettverket; ingen enkelt ruter vil vedlikeholde en liste over alle rutere. RouterInfos lagres p\u00e5 disk og leses inn i minnet n\u00e5r ruteren starter, eller n\u00e5r nye RouterInfos er hentet. Ogs\u00e5 omtalt som <i>NetDb</i>. For mer informasjon, se <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online dokumentasjonen</a>.";
    t[7692] = "Address";
    t[7693] = "Adresse";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "En terskel er definert av antall tilkoblingsfors\u00f8k en ekstern destinasjon har tillatelse til \u00e5 utf\u00f8re over et spesifisert antall sekunder f\u00f8r et \"brudd\" oppst\u00e5r.";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Klarwebb refererer vanligvis til det offentlig tilgjengelige internettet, motsatsen til darknet som vanligvis beskriver de krypterte, anonyme tjenestene bygget p\u00e5 I2P, Tor etc. For mer informasjon, se <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia-artikkelen</a>.";
