    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Hvor det er mulig, b\u00f8r ressurser som brukes gjentatte ganger p\u00e5 nettstedet ditt lastes fra en ekstern fil og ikke inline. Hvis du bruker samme CSS p\u00e5 flere sider, opprett en separat css-fil og last den i <code>&lt;head&gt;</code>-delen av sidene dine. Dette vil gj\u00f8re det lett \u00e5 h\u00e5ndtere stilendringer p\u00e5 nettstedet ditt, og lar ogs\u00e5 filen bli lagret i bes\u00f8kendes nettleser, noe som f\u00f8rer til mindre b\u00e5ndbreddekrav p\u00e5 webserveren din og raskere sidebelastning for bes\u00f8kende.";
