    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Du har konfigurert inng\u00e5ende TCP, men UDP-porten din er brannmurt og det er derfor sannsynlig at TCP-porten din ogs\u00e5 er brannmurt.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Dette er antallet jevnbyrdige maskiner ruteren din bruker for nettverksdatabasen. Dette er vanligvis <i>floodfill</i>-rutere som er ansvarlig for \u00e5 opprettholde nettverksintegriteten. De godt integrerte maskinene dine vises nederst p\u00e5 siden <a href='/profiles'>Profiler</a>.";
