    t[8335] = "Funksjon";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "P\u00e5 I2P-nettverket kan eksternt hosting av tjenester n\u00e5s ved hjelp av en <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a>-adresse som slutter p\u00e5 \".b32.i2p\", en destinasjon representert som en lang <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>-streng, eller som vanligvis ved hjelp av et .i2p-domene. En destinasjon er I2Ps ekvivalent til en IP-adresse, og vises p\u00e5 siden for <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration</a>. Du kan dele din b32.i2p-adresse for \u00e5 tillate andre \u00e5 f\u00e5 tilgang til nettstedet ditt inntil du har registrert ditt egne .i2p-domene.";
