    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "For \u00e5 deaktivere visning av kataloger, finn oppf\u00f8ringen for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> i filen <code>base-context.xml</code> i mappen <code>eepsite/contexts</code> (rett over docroot-mappen), og endre 'true' til 'false' umiddelbart under. For \u00e5 bruke endringen umiddelbart stopper og starter du klineten <i>I2P Webserver</i> p\u00e5 siden for <a href=/configclients>klientkonfigurasjon</a>. Du kan ogs\u00e5 legge en tom <code>index.html</code>-fil i en hvilken som helst eksponert mappe for \u00e5 undertrykke visningen av kataloger for den plasseringen.";
