    t[8555] = "Hvis du ikke bruker IE, er det sannsynlig at nettleseren din later som \u00e5 v\u00e6re IE; vennligst konfigurer nettleseren din (eller proxy) til \u00e5 bruke en annen brukeragentstreng hvis du vil f\u00e5 tilgang til konsolltemaene.";
