    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Loggene</a> kan hjelpe med \u00e5 l\u00f8se et problem. Du kan \u00f8nske \u00e5 lime inn utdrag i et <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for hjelp, eller kanskje <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>lime det inn</a> i stedet og referere til lenken p\u00e5 IRC for hjelp.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Filer signert med utviklerens kryptografiske n\u00f8kkel er det anbefalte formatet for plug-ins, men hvis du \u00f8nsker \u00e5 installere usignerte plug-ins (.zip), kan du sette dette til true. V\u00e6r oppmerksom p\u00e5 at du fremdeles kan st\u00f8te p\u00e5 problemer n\u00e5r du fors\u00f8ker \u00e5 installere en usignert plugin hvis utvikleren har inkludert ekstra sjekker i byggeprosessen for pluginen.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Hvis du kj\u00f8rer en frittst\u00e5ende Tor-instans lokalt, kan du bruke den ved \u00e5 konfigurere I2P til \u00e5 bruke: <i>Proxitype:</i> <code>SOCKS 5</code> <i>Vert:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
