    t[9053] = "Klar";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Dette er de lokale tjenestene som tilbys av ruteren din. De kan v\u00e6re klienter som er startet via <a href='/i2ptunnelmgr'>Tunnel Manager</a> eller eksterne programmer som kobler til gjennom SAM, BOB eller direkte til I2CP. Som standard vil de fleste av klientsidetjenestene dine (e-post, http-proxy, IRC) dele samme sett med tunneler og bli oppf\u00f8rt som <i>Delte klienter</i> og <i>Delte klienter (DSA)</i>, noe som forbedrer anonymiteten ved \u00e5 blande trafikken fra alle delte tjenester og reduserer overfl\u00f8dig arbeid som kreves for \u00e5 bygge og vedlikeholde tunneler. Imidlertid, hvis det oppst\u00e5r et tunnelfeil, vil alle tjenestene dine kobles offline samtidig, s\u00e5 i noen scenarier kan det v\u00e6re \u00f8nskelig \u00e5 konfigurere klientservicene til \u00e5 bruke sin egen sett med tunneler. Dette kan gj\u00f8res ved \u00e5 fjerne markeringen for alternativet <i>Del tunneler med andre klienter&hellip;</i>, som vises under <i>Delte klienter</i> p\u00e5 konfigureringssiden for den relevante klientservicen i Tunnel Manager, deretter m\u00e5 du starte klientservicen p\u00e5 nytt fra <a href='/i2ptunnelmgr'>hovedsiden for Tunnel Manager</a>.";
