    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "En enkel CGI-applikasjon som tar en vertsnavn som parameter og returnerer en 301-omdirigering til riktig URL med en <code>?i2paddresshelper=key</code>-streng som er lagt til. HTTP-proxyen vil tolke den tilf\u00f8yde strengen og bruke n\u00f8kkelen som den faktiske destinasjonen. I tillegg vil proxyen mellomlagre n\u00f8kkelen, slik at adressehjelperen ikke er n\u00f8dvendig f\u00f8r omstart, og tilby muligheten til \u00e5 legge til den l\u00f8ste adressen i adresseboken.";
