    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Som standard bidrar din I2P+ ruter til nettverket ved \u00e5 routingen av intern, ende-til-ende kryptert trafikk for andre rutere, kjent som <i>deltagelse</i>. B\u00e5ndbredde bidrag forbedrer anonymitetsniv\u00e5et til alle brukere i nettverket og maksimerer nedlastingshastigheten din.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Denne innstillingen tillater konfigurasjon av alternative NTP-servere som er n\u00f8dvendige for \u00e5 sikre at ruteren din opprettholder n\u00f8yaktig klokkeslett. [Standard er 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
