    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "V\u00e6r oppmerksom p\u00e5 at profileringsverkt\u00f8yet er avhengig av vedvarende bruk av klienttunneler for \u00e5 profilere jevnaldrende n\u00f8yaktig.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Hvis du har det travelt og ikke kan vente noen timer, kan du be folk om \u00e5 bruke en \"hopp\"-adressehjelper omdirigeringstjeneste. Dette vil vanligvis fungere innen noen minutter etter at du har registrert vertsnavnet ditt p\u00e5 samme nettsted. Test det f\u00f8rst ved \u00e5 skrive inn <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> i nettleseren din. N\u00e5r det fungerer, kan du fortelle andre \u00e5 bruke det.";
