    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "For \u00e5 konfigurere en alternativ webserver for bruk p\u00e5 I2P, kan du enten bruke den eksisterende webserver-tunnelen og <a href=/configclients>deaktivere standard webserveren</a> fra \u00e5 kj\u00f8re, eller opprette en ny HTTP Server-tunnel i <a href=/i2ptunnelmgr>Tunnel Manager</a>. Forsikre deg om at webserverens <i>lytteport</i> ogs\u00e5 er konfigurert i innstillingene for Tunnel Manager. For eksempel, hvis webserveren din lytter som standard p\u00e5 adressen 127.0.0.1 port 80, m\u00e5 du ogs\u00e5 forsikre deg om at <i>M\u00e5lporten</i> i siden for innstillingene til Tunnel Manager for tjenesten ogs\u00e5 er konfigurert til port 80.";
