    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "Tjenester kan v\u00e6re vert for flere rutere samtidig ved \u00e5 dele samme private n\u00f8kkel for destinasjonen. Multihoming kan videre forbedre sikkerhet og stabilitet til en server ved \u00e5 gi redundans. Hvis en server er multihomed, vil den opprettholde den tilbudte tjenesten n\u00e5r en server i gruppen er frakoblet. Dette gj\u00f8r det vanskeligere \u00e5 korrelere servernedetid med frakoblingen til en ruter.";
