    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Som standard vil I2P bruke standardnettleseren konfigurert i systemet for \u00e5 starte ved oppstart. Hvis du \u00f8nsker \u00e5 velge en annen nettleser, m\u00e5 du redigere router.config-filen din (eller <a href=/configadvanced>Avansert konfigurasjonsside</a> hvis du har aktivert avansert konsollmodus) og legge til en ny konfigureringslinje <code>routerconsole.browser=/path/to/browser</code> eller <code>routerconsole.browser=\\path\\to\\browser.exe</code> hvis du bruker Windows, og bytte ut <code>\\path\\to\\browser</code> med plasseringen av nettleseren du \u00f8nsker \u00e5 bruke. Merk: Hvis stien til nettleseren du har valgt inneholder mellomrom, m\u00e5 du kanskje omgi stien med anf\u00f8rselstegn, for eksempel <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
