    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "Denne innstillingen (i timer) lar deg manuelt konfigurere hvor gammel en RouterInfo m\u00e5 v\u00e6re for at den skal bli sjekket av jobben 'Refresh Routers'. Som standard \u00f8ker alderen til en RouterInfo f\u00f8r en oppdatering utf\u00f8res i henhold til st\u00f8rrelsen p\u00e5 NetDb, slik at den \u00f8ker i takt med st\u00f8rrelsen p\u00e5 NetDb. En verdi p\u00e5 0 vil tvinge jobben 'Refresh Routers' til \u00e5 sjekke hver eneste ruter i NetDb, uavhengig av alder.";
