    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Modemet eller ruteren din kan st\u00f8tte <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), som tillater automatisk portvideresending. S\u00f8rg for at UPnP-st\u00f8tte for I2P+ er aktivert p\u00e5 <a href=/confignet>konfigureringssiden</a>, og pr\u00f8v deretter \u00e5 aktivere UPnP p\u00e5 modem/ruter og eventuelt datamaskinen ogs\u00e5. Pr\u00f8v deretter \u00e5 starte ruteren <a href=/>I2P+</a> p\u00e5 nytt. Hvis det lykkes, skal I2P+ rapportere \"Status: OK\" i sidepanelet n\u00e5r I2P+-ruteren fullf\u00f8rer initialiseringskoblingstester.";
