    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Hvis du beveger musepekeren over overskriften <i>Router Info</i>, vises den avkortede rutens identitet (de f\u00f8rste fire tegnene (24 bits) av 44-tegnet (256-bit) Base64-rutens haikode). Den fulle hasjen vises p\u00e5 din <a href='netdb?r=.'>Nettverksdatabasens oppf\u00f8ring</a>. Aldri avsl\u00f8r dette for noen, da din rutens identitet er unikt knyttet til IP-adressen din i nettverksdatabasen.";
