    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Kataloglister (noen ganger referert til som virtuelle kataloger) er aktivert som standard, slik at du kan huse filene fra en undermappe av <code>docroot</code> uten \u00e5 opprette en side med lenker til filene. Du kan ogs\u00e5 serve innhold som eksisterer utenfor <code>docroot</code> ved \u00e5 bruke en <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolisk kobling</a> til den \u00f8nskede mappen.";
