    t[12201] = "Hvis antallet kjente kolleger synker under 50, vil I2P fors\u00f8ke \u00e5 s\u00e5 automatisk. Hvis fors\u00f8ket p\u00e5 \u00e5 s\u00e5 mislykkes, vil det vises en melding i sidepanelet med muligheten til \u00e5 s\u00e5 manuelt. Et mislykket fors\u00f8k p\u00e5 \u00e5 s\u00e5 kan oppst\u00e5 hvis brannmuren din begrenser utg\u00e5ende trafikk, du opplever nettverksproblemer, eller hvis s\u00e5foresp\u00f8rselen er blokkert helt.";
